  true,\n\t\"url\": null,\n\t\"notes\": \"Global Earthquake Proportional Economic
  Loss Risk Deciles is a 2.5 minute grid of earthquake hazard economic loss as proportions
  of Gross Domestic nnProduct (GDP) per analytical unit. Estimates of GDP at risk
  are based on regional economic loss rates derived from historical records of the
  Emergency Events Database (EM-DAT). Loss rates nnare weighted by the hazard's frequency
  and distribution. The methodology of Sachs et al. (2003) is followed to determine
  baseline estimates of GDP per grid cell. To better reflect the nnconfidence surrounding
  the data and procedures, the range of proportionalities is classified into deciles,
  10 class of an approximately equal number of grid cells of increasing risk. This
  nndataset is the result of collaboration among the Columbia University Center for
  Hazards and Risk Research (CHRR), International Bank for Reconstruction and Development/The
  World Bank, and nnColumbia University Center for International Earth Science Information
  Network (CIESIN). \",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
